	bitmap DWORD ?
	xpos DWORD ?
	ypos DWORD ?
SPRITE ENDS
ASSPRITE STRUCT
	bitmap DWORD OFFSET asteroid_000
	xpos DWORD ?
	ypos DWORD ?
	vely DWORD 0
ASSPRITE ENDS
GAMESTATE STRUCT
	state BYTE ?
	gameover BYTE ?
GAMESTATE ENDS
myShip SPRITE<>
gamestat GAMESTATE<0,0>
Asteroids ASSPRITE <,40,20,4>,<,100,20,2>,<,220,20,5>,<,300,20,3>,<,600,20,2>, <,520,20,5>,<,380,20,4>,<,460,20,4>
overtext BYTE "GAME OVER", 0
playtext BYTE "Press Space to play again",0
 
.CODE
GameOver PROTO
;; Note: You will need to implement CheckIntersect!!!

CheckIntersect PROC USES  ebx ecx edx edi esi oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP
	LOCAL upl:COORDS, botr:COORDS, upl2:COORDS,	botr2:COORDS
	mov eax, 0
	;;First object
	mov esi, oneBitmap

	mov ecx, (EECS205BITMAP PTR[esi]).dwWidth
	mov ebx, (EECS205BITMAP PTR[esi]).dwHeight
	;; divide height and width by 2
	shr ecx, 1
	shr ebx, 1
	mov edx, oneX
	mov edi, oneY

	;;upper left
	mov upl.cox, edx
	sub upl.cox, ecx
	mov upl.coy, edi
	sub upl.coy, ebx

	;;bottom right
	mov botr.cox,edx
	add botr.cox, ecx
	mov botr.coy, edi
	add botr.coy, ebx
	;;Second object
	mov esi, twoBitmap
	mov ecx, (EECS205BITMAP PTR[esi]).dwWidth
	mov ebx, (EECS205BITMAP PTR[esi]).dwHeight
	;; divide height and width by 2
	shr ecx, 1
	shr ebx, 1
	mov edx, twoX
	mov edi, twoY

	;;upper left
	mov upl2.cox, edx
	sub upl2.cox, ecx
	mov upl2.coy, edi
	sub upl2.coy, ebx

	;;bottom right
	mov botr2.cox,edx
	add botr2.cox, ecx
	mov botr2.coy, edi
	add botr2.coy, ebx
	
	;;check for intersections
	;; one object above the secondone
	mov ebx, upl2.coy
	cmp botr.coy, ebx
	jl Done

	;;one object is below of the second one
	mov ecx, botr2.coy
	cmp upl.coy, ecx
	jg Done

	;;one object is left of the second one
	mov ecx, upl2.cox
	cmp botr.cox, ecx
	jl Done

	;;one object is right of the second one
	mov ecx, botr2.cox
	cmp upl.cox, ecx
	jg Done

	;;Else, there is intersection
	mov eax, 1
Done:

	ret
CheckIntersect ENDP

KeyPressReactions PROC USES ebx ecx edx edi esi
	mov esi, KeyPress

	cmp esi, 0
	je Nothing

	cmp esi, VK_LEFT
	jne Otherkey
	mov ebx, myShip.xpos
	sub ebx, 5
	mov myShip.xpos, ebx
Otherkey:
	cmp esi, VK_RIGHT
	jne Nothing
	mov ebx, myShip.xpos
	add ebx, 5
	mov myShip.xpos,ebx

Nothing:
	ret
KeyPressReactions ENDP

InitialAsteroids PROC USES ebx edx edi esi
	mov gamestat.state, 0
	mov esi, 0
	mov edx, 0
	mov edi, LENGTHOF Asteroids
	jmp cond

loopcond:
	invoke BasicBlit, [Asteroids + esi].bitmap, [Asteroids + esi].xpos, [Asteroids + esi].ypos
	inc edx
	add esi, TYPE Asteroids
cond:
	cmp edx, edi
	jl loopcond
	ret
InitialAsteroids ENDP
	
UpdateASteroids PROC USES ebx ecx edx edi esi
	mov esi, 0
	mov edx,0 ;;the count
	mov edi, LENGTHOF Asteroids
	jmp Cond
loopcond:
	mov ebx, [Asteroids + esi].ypos
	mov ebx, 20
	mov [Asteroids + esi].ypos, ebx
	jmp Body
Body:
	mov ecx, [Asteroids + esi].ypos
	add ecx, [Asteroids + esi].vely
	mov [Asteroids + esi].ypos, ecx

	cmp [Asteroids + esi].ypos, 480
	jg loopcond

	
	invoke BasicBlit, [Asteroids + esi].bitmap, [Asteroids + esi].xpos, ecx

	inc edx
	add esi, TYPE Asteroids

Cond:
	cmp edx, edi
	jl Body
	ret
UpdateASteroids ENDP

ClearScreen PROC uses ecx edi
	mov ecx, 640*480
	mov edi, ScreenBitsPtr
	cld
	mov al, 0
	rep stosb
	ret
ClearScreen ENDP

PlayPause PROC uses esi
	mov esi, MouseStatus.buttons
	cmp gamestat.state, 1
	jne Zerostate
	cmp esi,MK_LBUTTON 
	jne Nothing
	mov gamestat.state, 0
	jmp Nothing
Zerostate:
	cmp esi, MK_LBUTTON
	jne Nothing
	mov gamestat.state, 1
Nothing:
	ret
PlayPause ENDP

GameCollisions PROC uses eax esi edx edi 
	mov esi, 0
	mov edx, 0
	mov edi, LENGTHOF Asteroids
	jmp Cond
Body:
	invoke CheckIntersect, myShip.xpos, myShip.ypos, myShip.bitmap, [Asteroids + esi].xpos, [Asteroids + esi].ypos, [Asteroids + esi].bitmap
	cmp eax, 1
	jne Increment
	mov gamestat.gameover, 1
	invoke GameOver

Increment:
	inc edx
	add esi, TYPE Asteroids

Cond:
	cmp edx, edi
	jl Body
	ret
GameCollisions ENDP

ResetState PROC uses ebx esi edx edi
	mov esi, 0
	mov edx, 0
	mov edi, LENGTHOF Asteroids
	jmp Cond
Body:
	mov ebx, [Asteroids + esi].ypos
	mov ebx, 20
	mov [Asteroids + esi].ypos, ebx

	inc edx
	add esi, TYPE Asteroids

Cond:
	cmp edx, edi
	jl Body
	ret
ResetState ENDP
GameOver PROC uses esi
	invoke DrawStr, offset overtext, 100, 100, 0ffh
	invoke DrawStr, offset playtext, 100, 120, 0ffh

	mov esi, KeyPress
	cmp esi, VK_SPACE
	jne Done
	mov gamestat.state, 0
	
	
Done:
	ret
GameOver ENDP
GameInit PROC
	mov ebx, 310
	mov myShip.xpos, ebx
	mov ecx, 400
	mov myShip.ypos, ecx

	mov edx, OFFSET fighter_001
	mov myShip.bitmap, edx
	invoke BasicBlit, OFFSET gamebackground, 320, 240
	invoke BasicBlit, myShip.bitmap, myShip.xpos, myShip.ypos
	invoke InitialAsteroids
	ret         ;; Do not delete this line!!!
GameInit ENDP


GamePlay PROC
	invoke PlayPause
	cmp gamestat.state, 1
	jne Done
	cmp gamestat.gameover, 1
	jne FUN
	mov esi, KeyPress
	cmp esi, VK_SPACE
	jne Done
	mov gamestat.gameover, 0
	invoke ResetState
FUN:
		invoke ClearScreen
		invoke BasicBlit, OFFSET gamebackground, 320, 240
		invoke BasicBlit, myShip.bitmap, myShip.xpos, myShip .ypos
		invoke KeyPressReactions
		invoke UpdateASteroids
		invoke GameCollisions
Done:
	
	ret         ;; Do not delete this line!!!
GamePlay ENDP

